		neonLogin.$container = $("#form_login");
		neonLogin.$recover = $('#form-recuperar');
		neonLogin.$reset = $('#form_reset');
		neonLogin.$survey = $("#survey_form_login");
		neonLogin.$primeiro = $("#primeiro_form_login");

