		var maf_email = "";
		var maf_redirect = "";
		
		var social_maf = $('#social_maf_form #social_maf').val();
		var social_email = $('#social_maf_form #social_email').val();
		var social_login = $('#social_maf_form #social_login').val();
		console.log("social maf:", social_maf);

		if (social_maf == 1) {
			setTimeout(function()
			{
				$(".login-page").removeClass('logging-in');
				neonLogin.resetProgressBar(false);
				maf_login = social_login;
				maf_email = social_email;
				maf_redirect = 'perfil';
				
			}, 1000);
		}

